MGCAddSnippet(1, "Title Page");
MGCAddSnippet(2, "List of Figures");
MGCAddSnippet(3, "List of Tables");
MGCAddSnippet(4, "The CalibreOPCpro tool performs optical and process correction (OPC) on chip layouts to compensate for lithography distortions inherent in the manufacturing process. It supports a mix of rule and simulation-based methods, and simulates corrections using optical and process models. By performing OPC, you can print smaller features more reliably and improve yield.");
MGCAddSnippet(5, "Both Calibre OPCpro and Calibre nmOPC are fully integrated with the complete set of Calibre RET tools. Calibre OPCpro, Calibre ORC, Calibre PRINTimage and CalibreOPCverify provide sparse OPC and OPC verification capabilities in an integrated flow. Together with CalibrenmDRC, CalibreOPCsbar, and Calibre FRACTURE, a complete hierarchical flow can be built on the Calibre platform.");
MGCAddSnippet(6, "These are the key concepts you need to understand to use the OPC and RET tools effectively:");
MGCAddSnippet(7, "The command descriptions use font properties and several metacharacters to document the command syntax.");
MGCAddSnippet(8, "The Calibre RET toolset can be run either in batch mode (that is, by executing a script at the shell prompt) or from within CalibreWORKbench, a graphical interface.");
MGCAddSnippet(9, "Runs for large sections of layout often use batch mode. Running OPC on full chip layouts can take hours.");
MGCAddSnippet(10, "Use the Calibre WORKbench viewer for exploring different correction schemes, viewing contours, and creating basic litho setup files via mini-OPC. ");
MGCAddSnippet(11, "This manual describes the operations of CalibreOPCpro, CalibreORC, and CalibrePRINTimage. ");
MGCAddSnippet(12, "In our experience with dozens of semiconductor manufacturers, one of the most critical factors for successful and rapid RET deployment is the formation of a cross-functional team.");
MGCAddSnippet(13, "The Calibre nmDRC hierarchical engine is the foundation for the Calibre RET solutions. This engine is a powerful layout design verification and correction tool you use for manipulating layer data, and performing design and manufacturability rule checks quickly and efficiently. The Calibre nmDRC hierarchical engine is also the starting point for the Calibre RET batch processes, coordinating data exchange between layout files and the tools. ");
MGCAddSnippet(14, "You begin with the Calibre nmDRC hierarchical engine, no matter which Calibre RET solution you use. There are two types of input you must supply when you invoke the Calibre nmDRC hierarchical engine. ");
MGCAddSnippet(15, "Starts a Calibre batch run.");
MGCAddSnippet(16, "The Calibre nmDRC hierarchical engine saves results and status information from each run in the formats summarized in this section.");
MGCAddSnippet(17, "Raw data for Calibre nmDRC hierarchical engine consists of polygons located on layers the IC designer has created. This section discusses the data the Calibre nmDRC hierarchical engine recognizes and creates, and the impact of layer types on the operations the hierarchical engine performs.");
MGCAddSnippet(18, "The Calibre nmDRC hierarchical engine distinguishes between four types of layers.");
MGCAddSnippet(19, "Each Calibre SVRF operation operates on polygon data or edge data or both. When classifying and manipulating data with SVRF, you must pay close attention to the type of data each operation returns: edge layers or polygon layers. ");
MGCAddSnippet(20, "Polygon reference data associates each edge with a specific polygon; consequently, you must pay close attention to the layer of origin—specifically, where the data comes from. ");
MGCAddSnippet(21, "The result of any SVRF operation is a collection of data. The Calibre nmDRC hierarchical engine can store collections of data in three main types.");
MGCAddSnippet(22, "The SVRF dimension check operations measure distances between opposing edges. Because dimension checks provide you with a means for classifying edges using key properties (for example, width and spacing), they are the foundation for RET-related processing.");
MGCAddSnippet(23, "The Calibre nmDRC hierarchical engine begins the measurement process by evaluating the edges on the layer (or pair of layers) for  appropriate  edge pairs, specifically, any pair of edges meeting the operation s criteria. The first criterion relates to the orientation of the edges. Each dimension check measures from a specific side of the first edge to a specific side of the second edge:");
MGCAddSnippet(24, "Once the Calibre nmDRC hierarchical engine has identified pairs of edges meeting the criteria, it creates measurement regions for each of the edges in a pair. The application measures the separation between edges using these measurement regions. Each measurement region extends in the direction of the dimension check, either outside or inside. It contains any point in this direction so the distance from the edge satisfies the constraint for the operation.");
MGCAddSnippet(25, "The final step in performing the dimension check returns those portions of the edges intersecting the measurement region for the opposing edge. Because the measurement region for edge A omits the line containing edge A, dimension checks omit any points of intersection, if they exist.");
MGCAddSnippet(26, "A Standard Verification Rule Format (SVRF) rule file is an ASCII text file containing legal SVRF statements and operations. It contains the statements and operations the Calibre application uses for reading in GDS data, processing the layer data, and applying an RET solution. ");
MGCAddSnippet(27, "The syntax requirements for SVRF rule files are summarized in the sections following.");
MGCAddSnippet(28, "This section summarizes the parts of an SVRF rule file. The contents of a basic SVRF rule file contain statements that specify all the settings for Calibre, operate on the layers, and write out the results.");
MGCAddSnippet(29, "Specification statements in a rule file identify the layout data for subsequent processing, provide basic information concerning how the tool will process the operations, and specify the output (results) location.");
MGCAddSnippet(30, "Layer operations and layer creation statements isolate specific layer data, modify this data, and generate new data.");
MGCAddSnippet(31, "You write data to the results database using the rule check statement. By default, the Calibre nmDRC hierarchical engine writes data resulting from a rule check statement to layer 0 of the primary results database; you define this database using the DRC Results Database statement. The DRC Check Map statement lets you direct rule check results to a specific layer or database file. ");
MGCAddSnippet(32, "The Calibre RET toolset includes the following model-based batch tools:");
MGCAddSnippet(33, "You control Calibre OPCpro, Calibre ORC, and Calibre PRINTimage operation by properly configuring the data and the application prior to running. The three tools have some difference in how the common options should be configured.");
MGCAddSnippet(34, "With the Calibre OPCpro batch tool, you define both generic and specific constraints on how edges are moved to correct EPEs. Generic constraints restrict movement of all edges on the layer being corrected. Specific constraints restrict movement of individual edges or sets of edges.");
MGCAddSnippet(35, "A typical set of constraints are external or internal spacing and width limits. Width and spacing rules define the minimum spacing and minimum width allowed for output shapes. Fragments are not moved if doing so would cause them or their two neighbors to violate these rules. If a violation exists before performing OPC, a fragment is not moved unless movement decreases the violation.");
MGCAddSnippet(36, "When performing OPC with the Calibre OPCpro batch tool, you use tagging commands to control correction of individual fragments or sets of fragments. ");
MGCAddSnippet(37, "The following files are required to run the Calibre Sparse OPC tools. Each is described in the subsequent sections. You can supply the setup parameters as a separate litho setup file, or within the SVRF rule file in the form of setup parameter blocks.");
MGCAddSnippet(38, "Typically, the design database for model-based RET is a GDS or OASISOASIS is a registered trademark of Thomas Grebinski and licensed for use to SEMI, San Jose. SEMI is a registered trademark of Semiconductor Equipment and Materials International.-formatted layout database. The Calibre RET batch tools operate on one mask at a time. However, the Calibre nmDRC hierarchical engine operates equally efficiently whether you supply the entire design database or a smaller database containing copies of only those layers used to create a single mask. Because of this, when you invoke any of the RET batch tools, you must explicitly pass the necessary layers to the tool by including them in the layer list for the LITHO operation.");
MGCAddSnippet(39, "An SVRF rule file is a text file containing SVRF operations used to perform design rule checks, manipulate data, and invoke the Calibre RET batch tools. SVRF rule files must follow the syntax and conventions for Standard Verification Rule Format (SVRF). ");
MGCAddSnippet(40, "The Calibre OPCpro, Calibre ORC, and Calibre PRINTimage batch tools are controlled through simulation parameters and settings that are stored as setup files. A setup file may be either a separate file or part of a LITHO statement. By convention, the name of a setup file includes the suffix .in such as my_opc.in. ");
MGCAddSnippet(41, "The Calibre RET tools use models to simulate the effects of the various processes involved in transferring an image onto a wafer. They support two types of models: optical and resist. ");
MGCAddSnippet(42, "Because the RET batch tools are invoked from within the Calibre nmDRC hierarchical engine, they return the results of their processing directly to the hierarchical engine in the form of derived layers or rule check statements—they do not generate any output files themselves.");
MGCAddSnippet(43, "Getting good results with OPCpro requires that you configure the tools properly before running the applications. Some of this configuration involves controlling how and where the tools perform the simulations, and some involves controlling what the batch tools do with the simulation results. Because configuration varies according to the tool you are running, you should consult the tool-specific chapters for discussions of how to use the various configuration parameters and commands to optimize results. Before you begin, it is helpful to understand some of the basic configuration concepts.");
MGCAddSnippet(44, "Fragments are important for correcting designs. A fragment can be an entire edge or part of an edge. Most fragments have a control site that measures edge placement errors (EPEs). Calibre OPCpro corrects EPEs by moving individual fragments.");
MGCAddSnippet(45, "A fragment is an edge or part of an edge. ");
MGCAddSnippet(46, "Fragments are important for correcting designs. They represent the smallest unit that can be moved. Fragments include a control site at which edge placement errors (EPEs) are reported.");
MGCAddSnippet(47, "The Calibre RET model-based tools recognize the following types of fragments: edge fragments, line-end fragments, space-end fragments, and jogs. There are also several objects relating to fragments, including control sites, control points, convex and concave corners, and features. This section illustrates these terms.");
MGCAddSnippet(48, "Fragmentation is the process of adding vertices to break up a layout polygon s edge (or part of an edge) into smaller segments. Instructions in the setup file let you control the number and location of vertices, which define the lengths and positions of the resulting fragments. These instructions take the form of variables, commands, and keywords.");
MGCAddSnippet(49, "When you fragment your features, there are several keywords that you can apply as constraint parameters to your fragmentation schemes. For instance, prior to applying fragmentation during an OPC run, you can set a minimum size constraint for the length of a fragment and the minimum size constraint for a feature to be fragmented. ");
MGCAddSnippet(50, "Because the Calibre OPCpro batch tool operates on individual fragments, different fragmentation schemes result in different mask designs. And because aerial image simulation data for all the batch tools is only collected at control sites on fragments, different fragmentation schemes can result in more or less accurate rule checking and results precision. Controlling fragmentation is therefore critical for producing high yield, printable mask designs.");
MGCAddSnippet(51, "The Calibre OPCpro tools support several different types of fragmentation: ");
MGCAddSnippet(52, "Intrafeature fragmentation evaluates each polygon on the layout, independent of other polygons, and adds vertices at set distances from the polygon corners. ");
MGCAddSnippet(53, "Interfeature fragmentation evaluates each polygon in terms of proximity to nearby features and adds vertices to edges that are within a specified distance from these features. A feature is defined as a non-collinear corner. Features are typically corners of nearby polygons. However, they can also be corners on the same polygon as the edge being fragmented. ");
MGCAddSnippet(54, "Maxedgelength fragmentation breaks long fragments into shorter fragments. ");
MGCAddSnippet(55, "Island-layer fragmentation inserts vertices where the edges on an opc layer or correction layer intersect edges or vertices on an island layer. ");
MGCAddSnippet(56, "Visible-layer fragmentation inserts vertices where the edges on an opc layer or correction layer intersect edges or vertices on a visible layer. ");
MGCAddSnippet(57, "Implicit fragmentation is fragmentation performed by the hierarchical engine to help manage promotion of data between levels of the hierarchy. This is necessary because the simulator must be able  see  all the geometries in an area in order to generate an accurate aerial image. Implicit fragmentation occurs automatically (no controls are necessary).");
MGCAddSnippet(58, "This section summarizes the different global fragmentation methods and the default order in which they are processed outside of fragmentLayer blocks. Use the litho setup variable OPC_NEW_FRAG_ORDER to choose between the default order and an alternate order.");
MGCAddSnippet(59, "Fragmentation can result from hierarchical interactions. During OPC, the edges may break in unexpected fashions, introducing unwanted edge movement and jogs. The figure illustrates an example of hierarchical interactions caused during implicit (automatic) fragmentation.");
MGCAddSnippet(60, "There may be occasions when you have edges that require fragmentation according to specific requirements. In these cases, the global fragmentation models would not apply and you require a custom edge fragmentation. This  special case  fragmentation can be controlled using the fragmentTag keyword.");
MGCAddSnippet(61, "In a multilayer mask, global fragmentation settings apply to all layers by default. Typically, your fragmentation schemes are set as global defaults in the setup file or SVRF rule file and apply to all layers.");
MGCAddSnippet(62, "If a setting is not specified within a particular fragmentLayer block, a default value is applied from global settings. The table specifies the default values applied for different keywords used in a fragmentLayer block. ");
MGCAddSnippet(63, "Before investing time and resources in a full RET batch tool run, you should test your fragmentation settings to verify that they behave as expected. Use the Calibre WORKbench or Calibre LITHOview application to perform and plot fragmentation on a small, flat area of the layout. The Frag button in the RET Flow Tool lets you display fragmentation vertices as small circles without running OPC. ");
MGCAddSnippet(64, "Once you fragment a polygon, you may only want to target minor adjustments to certain edges, rather than all fragments. To target those specific fragment edges, you can place unique tags to separate them from the rest of the fragments.");
MGCAddSnippet(65, "The RET batch tools provide several built-in tags. These are global tags, available for building custom tags.");
MGCAddSnippet(66, "One use case is to use the built-in tags when you have too much fragmentation on an edge. When viewing multiple breakpoints, it can be difficult to determine one set from another. These commands help you find out what caused them to be created. From there you can refine your fragmentation settings. ");
MGCAddSnippet(67, "In most situations, built-in tags do not give sufficient control over the edges, which means you must create tags that are specific to your design. Use the newTag command to create custom tagging schemes to identify particular sets of edges to control. ");
MGCAddSnippet(68, "Once you have created your tags, you can control the effect the RET tools have on the tagged edges. You can use tagging commands to control the movement of edges during OPC. You can set limits on how far edges can move in OPC or specify the type of OPC to perform on them (rule-based or model-based).");
MGCAddSnippet(69, "In the Calibre RET toolset, a tagging script serves several purposes. The primary purposes are to help analyze EPEs when running the Calibre ORC batch tool and to perform OPC on selected edges only.");
MGCAddSnippet(70, "Control sites are locations on the opc layer where simulation data is evaluated for edge placement errors (EPE). Calibre RET batch tools use the information from the control sites to assess the need for OPC, to evaluate the success of an OPC run, and to generate the simulated wafer image.");
MGCAddSnippet(71, "Sites are used to determine the simulated edge placement error (EPE), or the distance between the drawn edge location on the original design and the simulated edge location. ");
MGCAddSnippet(72, "You control the locations of the sites through fragmentation, the layer keyword in the setup file, and proper layer usage. Sites are automatically generated when fragmentation occurs. By default, the Calibre model-based RET batch tools create one control site on every edge fragment on the opc layer except jog fragments. ");
MGCAddSnippet(73, "Sites are divided into discrete points, starting at point 0 (sites number from the interior of the polygon outward). You can change the number of points, the angle at which the control site intersects the fragment, and how far the control site extends to each side.");
MGCAddSnippet(74, "By default, a site is placed perpendicular at the midpoint of a fragment. However, at corners this technique potentially gives far less precise results. You can get better simulation results by adjusting the position or angle of the site relative to its fragment. ");
MGCAddSnippet(75, "The Calibre RET batch tools operate on Calibre polygon layers. The opc layer containing the image you want to print on your wafer is the minimum layout data required to run the Calibre OPCpro batch tool. This minimum data is sometimes not the only data needed. You can improve overall results by providing additional layer data to include non-printing simulation data, generate fragments, and control correction.");
MGCAddSnippet(76, "There are seven layer types, each of which is described in the following sections. These layer types have meaning only with respect to the RET toolset. ");
MGCAddSnippet(77, "The Calibre RET batch tools begin by fragmenting the edges on the opc layer and correction layers. Most fragmentation occurs based on the fragmentation parameters defined in the setup file. You can force the system to create additional fragmentation vertices using island, asraf, and visible layer geometries. This type of fragmentation generates vertices wherever edges or vertices on these types of layers intersect geometries on the opc and correction layers.");
MGCAddSnippet(78, "You can use the layers you pass to the tool to classify edges into related sets. Once classified, you control which edges receive correction, and how much correction they receive. ");
MGCAddSnippet(79, "The setup file layer names must match the layers passed into the LITHO SVRF operation. The next few lines show an example for a layer called  POLY .");
MGCAddSnippet(80, "A tile is a rectangular area of a design that is processed as a unit. Large designs or cells are usually divided into tiles to improve processing speed. When performing OPC, Calibre OPCpro and Calibre WORKbench process the data in chunks, called tiles. If a cell is smaller than the specified tile size, it is processed as one tile. If a cell is larger than the tile size, it is divided into square tiles extending out from the lower left corner of the cell or layout.");
MGCAddSnippet(81, "The sparse OPC commands include both SVRF command and commands that appear in setup files. These commands control Calibre OPCpro, Calibre ORC, and Calibre PRINTimage.");
MGCAddSnippet(82, "There are four SVRF commands used by the sparse OPC tools.");
MGCAddSnippet(83, "Contains the litho setup file within an SVRF rule file.");
MGCAddSnippet(84, "The model-based Calibre RET tools all use litho setup files to provide tool-specific settings and operations within a Calibre DRC run. The file format as discussed in this manual also generally applies to non-sparse OPC tools, although there may be differences.");
