MGCAddSnippet(223, "Makes fragments collinear to smooth jogs.");
MGCAddSnippet(224, "Runs Matrix OPC, a feature for multiple mask OPC.");
MGCAddSnippet(225, "Creates new, user-defined tags using the methods described in subsequent reference pages.");
MGCAddSnippet(226, "Creates a new tag tagName containing everything that is tagged with tag1 AND tag2 AND … tagN. This identifies the intersection of two or more sets of fragments.");
MGCAddSnippet(227, "Tags all fragments on a source layer that are coincident with a marker layer.");
MGCAddSnippet(228, "Tags all fragments on the source layer that are inside coincident with a marker layer.");
MGCAddSnippet(229, "Tags all fragments on the source layer that are outside coincident with the marker layer.");
MGCAddSnippet(230, "Creates a new tag after model-based OPC based on how far the fragment moved (was displaced) during correction.");
MGCAddSnippet(231, "Tags all fragments on an edge that meets constraints. There are two mutually-exclusive tagging modes: FROMCORNER; or TYPE, LENGTH and ANGLE.");
MGCAddSnippet(232, "Tags all fragments with an Edge Placement Error (EPE) within a desired range.");
MGCAddSnippet(233, "Checks the EPE tolerances as a function of varying the threshold of the resist model.");
