MGCAddSnippet(237, "Tags all fragments before the edge tagged with tag1.");
MGCAddSnippet(238, "Tags all fragments before the fragment tagged with tag1.");
MGCAddSnippet(239, "Tags fragments based on their lengths and the types of corners at either end point.");
MGCAddSnippet(240, "Tags all fragments next to the edge tagged with tag1.");
MGCAddSnippet(241, "Tags all fragments next to the fragment tagged with tag1. ");
MGCAddSnippet(242, "Creates a subgroup based on whether a site was generated on tagged fragments. ");
MGCAddSnippet(243, "Tags fragments based on aerial image properties.");
