MGCAddSnippet(245, "Tags fragments based on the DRC INTERNAL dimension check.");
MGCAddSnippet(246, "Tags fragments on opc layers that intersect polygons on island layers.");
MGCAddSnippet(247, "Tags fragments on opc layers that do not interact with polygons on island layers.");
