MGCAddSnippet(252, "Tags all fragments on layer1 that are not tagged by COINCIDENTOUTSIDEEDGE.");
MGCAddSnippet(253, "Tags all fragments on layer1 that are not tagged by INSIDEEDGE.");
MGCAddSnippet(254, "Tags all fragments on layer1 that are not tagged by OUTSIDEEDGE.");
MGCAddSnippet(255, "Tags all fragments not tagged by the corresponding TOUCHEDGE.");
MGCAddSnippet(256, "Tags all layer1 fragments not tagged by the corresponding TOUCHINSIDEEDGE.");
MGCAddSnippet(257, "Tags all fragments not tagged by the corresponding TOUCHOUTSIDEEDGE.");
MGCAddSnippet(258, "Creates a new tag everything that is tagged with either tag1 OR tag2 OR … tagN. This allows you to find the union of two or more sets of fragments.");
MGCAddSnippet(259, "Tags source layer fragments that lie completely outside marker layer polygons.");
MGCAddSnippet(260, "Identifies a sequence of edges (multiple fragments per edge) and places all fragments that make up the sequence into the output tag set.");
MGCAddSnippet(261, "Creates a new tag by subtracting everything in tag2 to tagN from tag1.");
MGCAddSnippet(262, "Tags all layer1 fragments that are completely or partially coincidental with an edge on layer2.");
MGCAddSnippet(263, "Tags all layer1 fragments that are completely or partially inside coincidental with an edge on layer2.");
