MGCAddSnippet(268, "Moves sites on all tagged fragments that already have a site, and creates new sites if they do not exist.");
MGCAddSnippet(269, "This command is identical to the siteControl OFFSET_FROM command, except that its arguments are expressed as a fraction of the fragment's length, rather than distance.");
MGCAddSnippet(270, "A command that defines tag-specific site placement for each fragment using the site s coordinate system.");
MGCAddSnippet(271, "Moves sites on tagged fragments that already have a site toward a particular corner type, and creates new sites when they do not exist. This command is similar to siteControl SHIFT_TOWARD.");
MGCAddSnippet(272, "Shifts a control site towards a specified corner type.");
MGCAddSnippet(273, "Moves existing sites on fragments using a 2D Gaussian.");
MGCAddSnippet(274, "Trims the control sites for specific tagged fragments.");
MGCAddSnippet(275, "Creates boxes around tags or sites.");
MGCAddSnippet(276, "The built-in tags are used to globally select specific types of fragments, such as mid-edge segments or fragments at the initial fragmentation points. They can be used in any command calling for a tag.");
MGCAddSnippet(277, "The Calibre OPCpro batch tool performs optical process correction (OPC) on a mask layout to compensate for distortions introduced during the lithography process used to create a wafer. The resultant output is a mask layer, or set of mask layers, containing a modified version of the original data enhanced with features such as serifs, biasing, and line-end hammer heads.");
MGCAddSnippet(278, "There are a variety of methods by which Calibre OPCpro can be used to correct mask layouts, each depending on your design. The following sections describe five design and correction scenarios, including example setup and SVRF DRC files for illustration purposes.");
MGCAddSnippet(279, "This scenario describes applying model-based OPC to the POLY layer of a 180-nanometer design.");
MGCAddSnippet(280, "For this scenario, you are using sub-resolution assist features (SRAFs) such as scattering bars. SRAFs are not printed on the final mask. ");
MGCAddSnippet(281, "This scenario uses assist features such as layer fill that print on the final mask but should not be corrected by the OPC process. It is possible to have both printing features and non-printing features (such as scattering bars) in the same design.");
MGCAddSnippet(282, "For technology nodes above 90 nm, etch bias is compensated by applying a rule table through CalibreTDopc. This flow is known as etch retargeting, and is summarized in the figure.");
MGCAddSnippet(283, "Calibre OPCpro can run LITHO operations concurrently if all the LITHO operations have the same arguments and the same order of inputs except for the map number. If the LITHO statements are different in any other way, they are not executed concurrently. ");
MGCAddSnippet(284, "This example performs limited OPC on a subset of edges (line ends) and leaves the rest of the edges untouched. The first step is to identify the line ends. There is some overlap in capabilities between SVRF and the tagging commands and keywords. In general, logical operations are faster using SVRF and tagging commands are more concise for controlling movement of which edge fragments. ");
MGCAddSnippet(285, "This section begins with an extensive explanation of Matrix OPC and its uses for multiple masks and other advanced OPC situations.");
MGCAddSnippet(286, "For most binary and attenuated PSM mask RET, the final image in resist is formed by a conventional mask exposure. For many advanced RET schemes, the mask must be decomposed into multiple masks, such that the final post-OPC masks are radically different from the designed, or target, layer. ");
MGCAddSnippet(287, "Matrix OPC provides several different methods for mapping correction layer fragments to the associated fragment on the opc layer.");
MGCAddSnippet(288, "To calculate edge movement, Matrix OPC begins by associating each movable fragment with one or more simulation sites. This association takes the form of a mapping. Some properties you can map by are:");
MGCAddSnippet(289, "To check that Matrix OPC is mapping fragments to sites as you expected, you can view the mappings using Calibre WORKbench. You can generate the mapping data for the full chip when running in batch mode or for a test area by running mini-opc in Calibre WORKbench.");
MGCAddSnippet(290, "The following scenarios show some techniques for using Matrix OPC.");
MGCAddSnippet(291, "In this example, multiple tolerances are applied for EPE and for slope.");
MGCAddSnippet(292, "This example looks at the performance of Matrix OPC with slope optimization on a section of layout and also uses ORC to analyze its effectiveness in improving slope, compared to standard OPC.");
MGCAddSnippet(293, "When performing OPC on multiple masks used to create a single physical layer (for example, one created when using alternating Phase Shift Masks), it is sometimes necessary for checks to be performed between the different mask layers. The rule checking functionality provided through Calibre OPCpro, such as OPC_MIN_EXTERNAL and OPC_MIN_INTERNAL checks, checks only between features on the same mask. Enclosure rule checking, which is supported by six environment variables available through Matrix OPC, allows you to perform limited enclosure rule checks between different masks.");
MGCAddSnippet(294, "This example of using Matrix OPC with Calibre OPCpro walks you through how to use alternating phase shift masks with Matrix OPC.");
MGCAddSnippet(295, "Originally designed for performing Optical Rule Checking (ORC) to check the polygon edges in a layout to see whether or not they print within a user-specified tolerance, the Calibre ORC batch tool has evolved into a powerful tool that allows you to categorize polygon edges and fragments based on a wide range of properties and characteristics. You can use this tool many ways, chief among them being:");
MGCAddSnippet(296, "You can run ORC in two modes: standalone or as part of a Calibre OPCpro run. Both modes are equally effective, and there is no appreciable run time difference between running OPC and ORC as separate processes versus running them together. The primary difference between running ORC standalone and running as a part of an OPC run is that in standalone mode, you can specify with much finer fragmentation than what is typically used for OPC.");
MGCAddSnippet(297, "With the Calibre ORC batch tool, you use tagging commands to define conditions that are of special interest or concern. Like the Calibre OPCpro batch tool, this batch tool operates on edge fragments that result from fragmentation of polygon edges. The benefit of this is that you can identify exactly which portions of a polygon edge cause problems. A good fragmentation scheme breaks an edge into just enough fragments to ensure that portions of an edge with small errors or no errors are tagged differently than portions with larger errors. ");
MGCAddSnippet(298, "Property tagging refers to those ‑how methods or built-in tags that let you tag fragments based on length, angle, bias, and the type of fragment. The -how methods include:");
MGCAddSnippet(299, "Relationship tagging refers to seven -how methods that let you tag fragments based on their relationships to a nearby fragments. These are:");
MGCAddSnippet(300, "Topological tagging refers to sixteen -how methods that let you tag fragments based on their topological relationships to a marker layer. These methods are based on the SVRF operations with the same names. They select fragments only if the entire fragment meets the SVRF check constraints. ");
MGCAddSnippet(301, "Dimension check tagging lets you tag fragments based on width and spacing checks. The -how methods are:");
MGCAddSnippet(302, "EPE tagging tags fragments whose simulated edge lies within a specified distance from the drawn edge, which is on the opc layer. With this command, you can classify edges based on the type of edge, as well as the size of the placement error.");
MGCAddSnippet(303, "EPE sensitivity tagging lets you check how much the location of a printed edge varies as the process varies. This measure of process robustness is called the EPE sensitivity. It is expressed as a distance, defined as follows:");
MGCAddSnippet(304, "Image tagging tags fragments based on the properties of their aerial image. You can check for:");
MGCAddSnippet(305, "Displacement tagging tags fragments after model-based OPC based on how far the fragment moved (was displaced) during correction. The -how method is DISPLACEMENT. ");
MGCAddSnippet(306, "Boolean tagging tags fragments based on relationships between existing tags. ");
MGCAddSnippet(307, "The HAS_SITE -how method lets you tag fragments based on whether or not they have sites on them. ");
MGCAddSnippet(308, "The MRC -how method lets you tag fragments that did not move in the previous iteration. The restrictions could have originated from an MRC rule or other movement limitation. ");
MGCAddSnippet(309, "The Calibre ORC batch tool identifies problem edges by processing the tagging commands you used to define the problems that interest you. To inspect the errors, you must define an output format explicitly. By default, the ORC operation does not return any results to the hierarchical engine.");
MGCAddSnippet(310, "Writing ORC results as GDS layer data allows you to visually inspect the layout and distinguish between the various types of problems. To do this, you must generate new layers containing highlighting boxes drawn around each edge in the specified tag, then output the layer as a Calibre layer.");
MGCAddSnippet(311, "A histogram is a chart showing the number of occurrences of each type of error. You generate histogram data during ORC using the histogram tagging command, which instructs the Calibre ORC batch tool to generate a text file containing histogram data. To use this command, you should also specify the pathname for the file using the LITHO_HISTOGRAM_OUTPUT_FILE setup file variable. Otherwise, the histogram data is sent to the file. If no file is defined, histogram data is placed in the transcript.");
MGCAddSnippet(312, "One of the primary uses of ORC with OPCpro is gain more precise control over correction. ");
MGCAddSnippet(313, "Calibre ORC can be run as an independent operation, with no need to first run an OPC tool. Within the ORC setup file, there are keywords to perform fragmentation, simulate the print image, tag fragments and postprocess them.");
MGCAddSnippet(314, "When running ORC with Calibre OPCpro, you must choose between two possible flows. The difference lies in whether you use the fastIter command to trigger corrections or not.");
MGCAddSnippet(315, "This section contains a Calibre ORC usage example. It uses the Calibre ORC batch tool to find line_ends and compare them to EPEs. You output both types of fragments (line_ends and errors) as GDS layers. This allows you to discover which portion of the errors are caused by line_ends.");
MGCAddSnippet(316, "The Calibre PRINTimage batch tool performs optical and resist simulation to predict how mask features actually print on a wafer. You can use the Calibre PRINTimage batch tool in many ways, including the following:");
MGCAddSnippet(317, "The Calibre PRINTimage batch tool generates three types of images: SEM images, dense aerial, and dense print images. Differences in how and where this application simulates the images lead to differences in the types of information they provide, which in turn lead to different uses. The following sections describe these differences.");
MGCAddSnippet(318, "You control the process the Calibre PRINTimage batch tool uses to generate and draw printed (SEM) images by using variables and keywords in the setup file. The following sections describe the control you have over PRINTimage behavior.");
MGCAddSnippet(319, "The Calibre nmDRC hierarchical engine saves PRINTimage results as a derived layer. You can view this layer using any GDS viewer or layout editor, such as the Calibre WORKbench or Calibre LITHOview application, or the Pyxis Layout Editor application.");
MGCAddSnippet(320, "You run the Calibre PRINTimage batch tool from within the Calibre nmDRC hierarchical engine, which you invoke using the calibre command from a Linux command line. ");
MGCAddSnippet(321, "This simple example uses the Calibre PRINTimage batch tool to generate an SEM image for a simple binary mask. ");
MGCAddSnippet(322, "This chapter outlines several best practices when using Calibre OPCpro to correct distortions on a mask input layer introduced by optical and resist processes. This chapter contains the following sections:");
MGCAddSnippet(323, "The following table summarizes recommended settings for OPCpro setup file commands for better performance and results.");
MGCAddSnippet(324, "The recommendations described in the following table are important for creating the fastest possible OPCpro runs.");
MGCAddSnippet(325, "Most best practices for fragmentation depend on the layer type and the interaction of settings. ");
MGCAddSnippet(326, "There are three types of inconsistency generally found in OPCpro runs:");
MGCAddSnippet(327, "The variable LITHO_SIMULATE_CONTEXT resolves the majority of inconsistencies found near hierarchical and tile boundaries. It does this by resimulating the context region at the current hierarchy level (promoting) for valid fragments.");
MGCAddSnippet(328, "Recipe convergence is also referred to as stability. If a recipe is unstable, improve it by optimizing feedback and making smaller adjustments.");
MGCAddSnippet(329, "The MRC_RULE setup keyword allows you to specify internal or external constraints between layers based on the distance between fragments as well as fragment length. The following practices improve your OPC results when using MRC_RULE:");
MGCAddSnippet(330, "Jogs can be simulated and moved just like any other fragment. However, their small size typically means that controlling the EPE on the jog edge is unimportant. Furthermore, moving the jog edges can cause more critical fragments to be blocked by MRC constraints while not substantially improving the printed image.");
MGCAddSnippet(331, "Different layer types can be optimized to produce better results. ");
MGCAddSnippet(332, "");
MGCAddSnippet(333, "Details on open source and third-party software that may be included with this product are available in the <your_software_installation_location>/legal directory.");

